import NFT1 from '../assets/imgs/NFT Line.png';
import NFT2 from '../assets/imgs/NFT M.png';
import NFT3 from '../assets/imgs/NFT MW.png';
import NFT4 from '../assets/imgs/NFT cap.png';
import NFT5 from '../assets/imgs/NFT fox.png';
import NFT6 from '../assets/imgs/NFT man.png'

import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import '../assets/css/Future.css';

function Future() {

    return (
        <>
            <div className='body-bg'>
                <Container className='cccontain' fluid="md">


                    <div className='rrrow-1'>

                        <h1>The Future of Web3 NoCode
                        </h1>
                        <p>Web3Makr allows you to incorporate top ranked blockchain platforms into your work through the drag and drop feature.
                        </p>
                    </div>
                    <Row className='rrrow-2'>
                        <Col className='cccol-1' sm={3}>
                            <p>Multi-Chain</p>
                            <p>DashBoard</p>
                            <p>Tool</p>
                        </Col>
                        <Col sm={9}>
                            <Row>
                                <Col sm={4}>

                                    <img src={NFT1} alt="Image 1" />
                                </Col>
                                <Col sm={4}>
                                    {/* Image 2 */}
                                    <img src={NFT2} alt="Image 2" />
                                </Col>
                                <Col sm={4}>
                                    {/* Image 3 */}
                                    <img src={NFT3} alt="Image 3" />
                                </Col>
                            </Row>
                            <Row>
                                <Col sm={4}>
                                    {/* Image 4 */}
                                    <img src={NFT4} alt="Image 4" />
                                </Col>
                                <Col sm={4}>
                                    {/* Image 5 */}
                                    <img src={NFT5} alt="Image 5" />
                                </Col>
                                <Col sm={4}>
                                    {/* Image 6 */}
                                    <img src={NFT6} alt="Image 6" />
                                </Col>
                            </Row>
                        </Col>

                    </Row>
                </Container>
            </div>
        </>

    );
}

export default Future;
